import React from 'react';

export default function Simulation() {
    return (
        <div>
            <Container maxWidth="sm">
                <form className={classes.root} noValidate autoComplete="off">
                     <TextField id="standard-basic" label="Standard" />
                </form>
            </Container>
        </div>
    )
}
